import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import ProblemCard from '../components/ProblemCard';

const Home = () => {
    return (
        <Container fluid>
            <Row>
                <Col>
                    <ProblemCard xs={12} md={6} />
                </Col>
                <Col>
                    <ProblemCard xs={12} md={6} />
                </Col>
            </Row>
        </Container>
    );
};

export default Home;
